import React from 'react';
import './App.css';
import {BrowserRouter} from 'react-router-dom';
import foto from './foto.jpg';

function About(props){
  const pic = <img id="about-foto" src={foto} alt="Not Found"></img>;
  const para = <p>Michael is a certified public accountant, interested in web development and data engineering. Michael
      has experience working with Python for web development using Flask, and for data analysis using Pandas and Dash. He
      also has experience using SQL in Postgres and SQLite. This website was built using ReactJS.
      </p>;

return (<div className="about">{pic}<div>{para}
    <p>In his spare time he enjoys guitar, coffee, and long bike rides on the beach.</p></div></div>);


}

function Project(props){

}


function ListLink(props){
  return props.items.map((item)=>
    (<li>
      <a target="_blank" rel="noreferrer noopener" href={item.link}>
      {item.name}
      </a>
    </li>));
}

function App() {
  const links = [{link:"#projects", name:"Projects"},
                  {link:"https://www.github.com/mrcrnkovich", name:"GitHub"},
                  {link:"https://www.linkedin.com/in/michaelcrnkovich", name:"LinkedIn"},
                  {link:"#about", name:"About"}];
  const HeaderLinks = <ListLink items={links} />;

  const proLinks = [{link:"https://www.github.com/mrcrnkovich", name:"CRM"},
                    {link:"https://www.github.com/mrcrnkovich", name:"CRM"},
                    {link:"https://www.github.com/mrcrnkovich", name:"CRM"},
                    {link:"https://www.github.com/mrcrnkovich", name:"CRM"}];
  const projectLinks = <ListLink items={proLinks} />;
  return (
    <div className="App">
        <nav class="menu">
          <h1>Michael Crnkovich</h1>
          <ul id="menu">
            {HeaderLinks}
          </ul>
        </nav>
        <div id="content">
        <h3 id="about">About</h3>
        <About />
        <h3 id="projects">Projects</h3>
        <ul id="projectList">
          <img className="thumbnail" src={foto} />
          {projectLinks}
        </ul>
        </div>
    </div>
  );
}

export default App;
